                    sourcesContent: ['<template>\r\n    <div class="partitionTree">\r\n        <div class="treeTitle">\r\n            <h2><i class="el-icon-arrow-down"></i>分区选择</h2>\r\n        </div>\r\n        <div class="treeContent">\r\n                <el-tree\r\n                    style="color: #494949;"\r\n                    :props="props"\r\n                    :load="loadNode"\r\n                    :expand-on-click-node=\'false\'\r\n                    @node-click="handleNodeClick"\r\n                    node-key="id"\r\n                    lazy>\r\n                        <span class="custom-tree-node" slot-scope="{ node, data }"><span> {{ node.label }} </span></span>\r\n                </el-tree>\r\n        </div>\r\n    </div>\r\n</template>\r\n\r\n<script>\r\nimport { getGisService } from "./../Util/queryMap.js";\r\nexport default {\r\n    name: \'partitionTree\',\r\n    data() {\r\n        return {\r\n            props: {\r\n                id: \'id\',\r\n                label: "name",\r\n                children: "zones",\r\n                isLeaf: "leaf"\r\n            },\r\n            partitionName: \'1\'\r\n        }\r\n    },\r\n    methods: {\r\n        /**\r\n         * 点击该分区，将该分区的数据传给不同的组件\r\n         */\r\n        handleNodeClick(data, node, nodeobj) {\r\n            let partitionName;\r\n            if (node.level === 1) {\r\n                partitionName = data.label.toString();\r\n            } else {\r\n                partitionName = data.relation + \'-\' + data.label.toString();\r\n            }\r\n            this.partitionName = partitionName;\r\n            this.$emit(\'partitionName\', this.partitionName, node)\r\n        },\r\n        /**\r\n         * 异步加载树状结构\r\n         */\r\n        loadNode(node, resolve) {\r\n            let GisService = {};\r\n            if (node.level === 0) {\r\n                GisService = {\r\n                    customQuery: "1=1",\r\n                    level: "12"\r\n                };\r\n            } else if (node.level === 1) {\r\n                GisService = {\r\n                    customQuery: "所属=\'" + (node.data.label).toString() + "\'",\r\n                    level: "11"\r\n                };\r\n            } else if (node.level === 2) {\r\n                GisService = {\r\n                    customQuery: "所属=\'" + node.data.relation + \'-\' + (node.data.label).toString() + "\'",\r\n                    level: "10"\r\n                };\r\n            } else if (node.level === 3) {\r\n                GisService = {\r\n                    customQuery: "所属=\'" + node.data.relation + \'-\' + (node.data.label).toString() + "\'",\r\n                    level: "10"\r\n                };\r\n            }\r\n            this.id = GisService.customQuery;\r\n            setTimeout(() => {\r\n                getGisService({ ...GisService }).then(data => {\r\n                let datas = [];\r\n                if (data.length > 0) {\r\n                    [...data].forEach(item => {\r\n                        datas.push({\r\n                            "name": item.attributes.层级 + "---" + item.attributes.编号,\r\n                            "label": item.attributes.编号,\r\n                            "relation": item.attributes.所属,\r\n                            "geometry": item.geometry\r\n                        });\r\n                    });\r\n                }\r\n                this.$emit(\'init\', datas)\r\n                resolve(datas);\r\n                });\r\n            }, 500);\r\n        }\r\n    }\r\n}\r\n<\/script>\r\n\r\n<style lang="scss">\r\n@import "./../../assets/css/variable.scss";\r\n.partitionTree {\r\n    background: $regionsColor;\r\n    height: 100%;\r\n    width: 315px;\r\n    border-radius: 7px;\r\n    box-shadow: 2px 2px 30px #eee,-2px -2px 30px #eee;\r\n    .treeTitle {\r\n        h2 {\r\n            font-size: $smallTitleSize;\r\n            font-weight: normal;\r\n            color: $regionsColor;\r\n            height: 50px;\r\n            line-height: 50px;\r\n            text-align: left;\r\n            width: 100%;\r\n            padding-left: 20px;\r\n            box-sizing: border-box;\r\n            background-color: $regionsTitleColor;\r\n            border-radius: 7px 7px 0 0;\r\n            i {\r\n                margin-right: 10px;\r\n            }\r\n        }\r\n    }\r\n    .treeContent {\r\n        height: calc(100% - 50px);\r\n        .el-tree {\r\n        .el-tree-node {\r\n            &.is-current {\r\n            >.el-tree-node__content {\r\n                background-color:  rgba(200, 200, 200, 0.8);\r\n            }\r\n            }\r\n            .el-tree-node__content {\r\n                background-color: $regionsColor;\r\n                padding-top: 10px;\r\n                padding-bottom: 10px;\r\n            }\r\n            .el-tree-node__label {\r\n                font-size: 16px;\r\n            }\r\n            .el-tree-node__expand-icon {\r\n                font-size: 16px;\r\n            }\r\n            .el-tree-node__expand-icon+span::before {\r\n                display: inline-block;\r\n                vertical-align: bottom;\r\n\r\n            }\r\n            .el-tree-node__loading-icon{\r\n                display: none;\r\n            }\r\n\r\n            .el-tree-node__content{\r\n                .custom-tree-node::before  {\r\n                    content: url(../../../static/img/desktop.png);\r\n                }\r\n            }\r\n            .el-tree-node__children{\r\n                .custom-tree-node::before {\r\n                    content: url(../../../static/img/desktop.png);\r\n                }\r\n            }\r\n        }\r\n        }\r\n    }\r\n}\r\n</style>\r\n']
